ga28(){return"Map showing location of Chichen Itza in Yucat\xe1n State, Mexico."},
ga24(){return"Desde el fondo de mi peque\xf1o corazoncito, quiero agradecerte por estar aqu\xed en este d\xeda tan especial. Aunque a\xfan no he llegado al mundo, ya puedo sentir todo el amor y la alegr\xeda que me rodea gracias a tu presencia. Cada sonrisa, cada palabra de cari\xf1o y cada momento compartido hacen que este Baby Shower sea inolvidable para mi familia y para m\xed. \nTu compa\xf1\xeda significa mucho para nosotros, porque este es un momento lleno de ilusi\xf3n y felicidad. Saber que hay tantas personas esperando con ansias mi llegada me hace sentir muy querido y afortunado. Gracias por tomarte el tiempo de venir a celebrar junto a nosotros y por ser parte de este cap\xedtulo tan importante en nuestra historia."},
ga25(){return"Espero que este d\xeda tambi\xe9n sea especial para ti, lleno de momentos hermosos y risas compartidas. Pronto podr\xe9 conocerte en persona y darte un tierno abrazo. Hasta entonces, me quedo con la alegr\xeda de saber que ya eres parte de mi vida y de esta hermosa bienvenida."},
ga22(){return"Mis papitos est\xe1n llenos de emoci\xf3n y gratitud por todo el amor que han recibido hoy. Cada detalle, cada palabra de aliento y cada gesto de cari\xf1o les ha recordado lo afortunados que son de tener personas tan especiales en sus vidas. Este Baby Shower no solo es una celebraci\xf3n para darme la bienvenida, sino tambi\xe9n una oportunidad para ellos de agradecer por la compa\xf1\xeda y el apoyo de cada uno de ustedes. \nHan sido meses de preparaci\xf3n, de sue\xf1os y expectativas sobre c\xf3mo ser\xe1 mi llegada, y saber que tienen a tantas personas queridas a su lado les llena el coraz\xf3n de tranquilidad y felicidad. No hay palabras suficientes para expresar lo agradecidos que est\xe1n por compartir con ellos este momento tan importante."},
ga23(){return"Desde ya, mis papitos prometen rodearme siempre de amor y ense\xf1arme el valor de la amistad y la familia. Gracias por ser parte de nuestro camino, por estar aqu\xed hoy y por todo lo que han hecho por nosotros. Su cari\xf1o y compa\xf1\xeda significan el mundo para ellos."},
ga26(){return"Cada regalo que hemos recibido hoy es una muestra del amor y la ternura con la que me esperan. No importa el tama\xf1o o el valor, porque cada uno ha sido elegido con cari\xf1o y pensado para hacer m\xe1s especial mi llegada. Desde ropita hasta peque\xf1os detalles, todo ser\xe1 parte de mi vida cuando por fin est\xe9 aqu\xed con mis papitos."},
ga27(){return"Prometo usar cada regalo con mucha alegr\xeda y, cuando sea m\xe1s grande, mis papitos me contar\xe1n sobre el hermoso d\xeda en que me llenaron de tanto amor. Gracias por pensar en m\xed, por hacerme sentir tan especial y por todo el cari\xf1o que me han dado incluso antes de conocerme. \xa1Los quiero mucho! \ud83d\udc95"},
