ga2I(){return"It was used for gladiatorial contests and public spectacles including animal hunts, executions, reenactments of famous battles, and dramas based on Roman mythology, and mock sea battles."},
ga2J(){return"It is the largest ancient amphitheater ever built, and is still the largest standing amphitheater in the world today, despite its age."},
ga2Y(){return"\u201cAncient Rome 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga2Q(){return"Map showing location of papitos in Rome, Italy,"},
ga2M(){return"Katty y Renzo se conocieron en la universidad, un lugar donde sus caminos se cruzaron por primera vez y donde poco a poco naci\xf3 una conexi\xf3n especial. Con el tiempo, descubrieron que compart\xedan intereses, sue\xf1os y una complicidad que los hac\xeda inseparables. Fue as\xed como, el 21 de agosto del 2021, decidieron comenzar una historia juntos, llena de amor y compa\xf1\xeda."},
ga2N(){return"Desde entonces, han compartido incontables aventuras, explorando lugares nuevos y disfrutando de cada peque\xf1o momento. Desde salidas al cine hasta largas caminatas por el parque, cada experiencia ha sido un recuerdo valioso que ha fortalecido su relaci\xf3n. Las risas espont\xe1neas, las conversaciones interminables y las emociones compartidas han convertido su historia en un hermoso viaje. \nPero no todo ha sido f\xe1cil, y en los momentos dif\xedciles han aprendido a sostenerse el uno al otro. Han enfrentado retos juntos, brind\xe1ndose apoyo incondicional y demostrando que el amor verdadero se construye d\xeda a d\xeda. Su relaci\xf3n es un reflejo de compromiso, cari\xf1o y la certeza de que, pase lo que pase, siempre estar\xe1n el uno para el otro."},
ga2K(){return"Desde el inicio de su relaci\xf3n, Katty y Renzo han encontrado en cada fecha especial una oportunidad para crear recuerdos inolvidables. Uno de los momentos m\xe1s divertidos que han compartido fue en Halloween, cuando decidieron disfrazarse juntos y salir a recorrer las calles. Acompa\xf1ados de sus fieles perritos, Rocky y Gigi, vivieron una noche llena de risas, emoci\xf3n y muchas golosinas que terminaron acumulando en grandes cantidades. \nPero la magia de las celebraciones no termin\xf3 ah\xed. Durante la Navidad, se aventuraron al Mall del Sur para visitar la villa navide\xf1a, un lugar donde la ilusi\xf3n de la temporada los envolvi\xf3 por completo. Rodeados de luces brillantes y decoraciones festivas, caminaron entre los adornos y figuras navide\xf1as, sintiendo el esp\xedritu de la \xe9poca en cada rinc\xf3n."},
ga2L(){return"La experiencia se volvi\xf3 a\xfan m\xe1s especial cuando, de repente, la nieve artificial comenz\xf3 a caer a su alrededor. Entre juegos, fotos y carcajadas, disfrutaron como ni\xf1os de ese m\xe1gico momento. Fue una de esas vivencias que quedar\xe1 guardada en sus corazones, record\xe1ndoles que, m\xe1s all\xe1 de los lugares que visitan, lo m\xe1s valioso es la alegr\xeda de compartir juntos cada instante."},
ga2O(){return"El d\xeda de la revelaci\xf3n de g\xe9nero fue un momento lleno de emoci\xf3n y alegr\xeda. Katty y Renzo reunieron a toda la familia para compartir este instante tan especial, donde todos intentaron adivinar si ser\xeda ni\xf1o o ni\xf1a. Las apuestas estaban divididas, algunos convencidos de que ser\xeda un ni\xf1o y otros seguros de que una ni\xf1a estaba en camino. Cuando lleg\xf3 el gran momento, un estallido de color rosa confirm\xf3 la noticia: \xa1soy una ni\xf1a! Entre aplausos, risas y abrazos, la felicidad se hizo presente, y los pocos que acertaron celebraron con orgullo su intuici\xf3n."},
ga2P(){return"Despu\xe9s de la gran revelaci\xf3n, la celebraci\xf3n continu\xf3 con una deliciosa comida preparada con mucho cari\xf1o. Entre bocaditos, postres y platos exquisitos, todos disfrutaron de un momento especial en familia. Las conversaciones estuvieron llenas de buenos deseos y an\xe9cdotas divertidas, creando recuerdos inolvidables. Fue un d\xeda m\xe1gico, lleno de amor y emoci\xf3n, marcando el inicio de una hermosa espera por mi llegada."},
ga2E(){return"papitos construction was started during the Vespasian reign overtop what used to be a private lake for the previous four emperors. This was done in an attempt to revitalize Rome from their tyrannical reign."},
ga2F(){return"The uppermost floor was built, and the structure was officially completed by Domitian."},
ga2A(){return"The arena was repurposed as a fortress for the Frangipane and Annibaldi families. It was also at one point used as a church."},
ga2B(){return"Pope Alexander VI permitted the site to be used as a quarry, for both storing and salvaging building materials."},
ga2C(){return"Preservation of the papitos officially began, after more than a millennia of dilapidation and vandalism. Pope Pius VIII was notably devoted to this project."},
ga2D(){return"A restoration project was undertaken to ensure the papitos remained a major tourist attraction for Rome. It currently stands as one of the greatest sources of tourism revenue in Italy."},
