gQI(){return"Aunque todav\xeda estoy en camino, ya puedo sentir lo especial que ser\xe1 este d\xeda. El 22 de marzo de 2025 no es solo una fecha cualquiera; es el d\xeda en que todos ustedes, las personas m\xe1s importantes en la vida de mis pap\xe1s (\xa1y la m\xeda tambi\xe9n! \ud83d\udc95), se reunir\xe1n para celebrar mi pronta llegada."},
gQJ(){return"Desde el c\xe1lido latido del coraz\xf3n de mi mami hasta la emoci\xf3n en los ojos de mi papi, s\xe9 que este Baby Shower ser\xe1 un d\xeda lleno de amor, risas y momentos inolvidables. \xa1No puedo esperar para conocerlos a todos! Pero mientras tanto, quiero contarles un poco de lo que har\xe1 que este d\xeda sea tan m\xe1gico. \nM\xe1s all\xe1 de ser una celebraci\xf3n, este d\xeda marcar\xe1 el inicio de una nueva etapa en la vida de mis pap\xe1s. Ser\xe1 el momento en el que, rodeados de su familia y amigos, sentir\xe1n a\xfan m\xe1s el apoyo y cari\xf1o que los acompa\xf1ar\xe1 en esta aventura de ser padres. Para m\xed, aunque a\xfan no haya nacido, este ser\xe1 el primer gran evento donde todos se reunir\xe1n con alegr\xeda, esperando con ansias el d\xeda en que finalmente pueda estar en sus brazos."},
gQG(){return"Este d\xeda ser\xe1 muy especial porque reunir\xe1 a muchas personas queridas en un mismo lugar. Algunos vendr\xe1n de lejos, otros de cerca, pero todos con el mismo prop\xf3sito: celebrar mi llegada. Ser\xe1 un momento de reencuentros, abrazos y muchas sonrisas."},
gQH(){return"Mientras mi mami y mi papi conversan con cada uno de ustedes, yo tambi\xe9n estar\xe9 escuchando desde aqu\xed. Reconocer\xe9 sus voces y sentir\xe9 el cari\xf1o con el que hablan de m\xed. Aunque a\xfan no pueda verlos, s\xe9 que cada risa y cada palabra me llenar\xe1 de amor. \nCuando llegue el momento de compartir juntos, quiero que disfruten, jueguen y se diviertan mucho. Cada instante de este d\xeda quedar\xe1 guardado en la memoria de mis pap\xe1s, y cuando crezca, me contar\xe1n c\xf3mo fue este maravilloso Baby Shower."},
gQK(){return"Mis pap\xe1s han estado esperando con ansias este d\xeda porque saben que ser\xe1 una celebraci\xf3n llena de alegr\xeda. Cuando levanten sus copas para brindar, estar\xe1n celebrando no solo mi llegada, sino el amor y la uni\xf3n que nos rodea."},
gQL(){return"Cuando finalmente llegue el d\xeda en que pueda conocerlos en persona, mis pap\xe1s me contar\xe1n cada detalle de esta celebraci\xf3n. Me dir\xe1n qui\xe9nes vinieron, qu\xe9 cosas lindas dijeron y c\xf3mo se sinti\xf3 tenerlos cerca. Y aunque a\xfan no puedo decirlo con palabras, desde ahora ya les env\xedo un gran \xa1gracias!"},
gQB(){return"First landmark of the Great Wall began originally as a square wall surrounding the state of Chu. Over the years, additional walls would be built and added to it to expand and connect territory."},
gQy(){return"The first Qin Emperor unifies China and links the wall of the surrounding states of Qin, Yan, and Zhao into the Great Wall of China, taking 10 years to build with hundreds of thousands of laborers."},
gQw(){return"A 20-year construction project was started by the Han emperor to build east and west sections of the wall, including beacons, towers, and castles. Not just for defense, but also to control trade routes like the Silk Road."},
gQz(){return"The Bei Qi kingdom also launched several construction projects, utilizing over 1.8 million workers to repair and extend sections of the wall, adding to its length and even building a second inner wall around Shanxi."},
gQA(){return"The Great Wall was repaired during the Sui Dynasty and used to defend against Tujue attacks. Before and after the Sui Dynasty, the wall saw very little use and fell into disrepair."},
gQx(){return"Hongzhi Emperor split the walls into north and south lines, eventually shaping it into how it is today. Since then, it has gradually fallen into disrepair and remains mostly unused."},
